import ReactDOM from "react-dom";
import pokemonList from './App.js';

const Pokemon = ({ id, name }) => (
    <div>
      <p>{id}</p>
      <p>{name}</p>
    </div>
  )

 export default function renderPokemon() {
    console.log(pokemonList);
    ReactDOM.render(
      pokemonList.map((pokemon) => (
        <Pokemon
          id={pokemon.id}
          name={pokemon.name}
          />
      )),
      document.getElementById('root')
    )
  }
